import { readFileSync } from "fs";
import path from "path";
import React from "react";

export function getStaticProps() {
  const file = path.join(__dirname, `/docs/styleguide/build/bundle.js`);
  const bundle = readFileSync("");
  const template = '<div id="rsg-root"></div><script>${bundle}</script>';
  return template;
}
function Docs({
  template = `<p>Remember to run <blockquote>cd docs && npm run build</blockquote></p>`,
}) {
  return <div dangerouslySetInnerHTML={{ __html: `${template}` }} />;
}

export default Docs;
